'''喵帕斯'''（にゃんぱすー，Nyanpasu-）是《[[悠哉日常大王]]》中，[[宫内莲华]]和人打招呼时用的一句台词。
==简介==
和“早中晚上好”一样是小孩子的自创用语，没有什么特别的含义<ref>[http://acg.178.com/201311/178152767112.html 萌作「悠哉日常大王」年底新动向 官方解答喵帕斯的意思  178动漫频道]</ref>。台版翻译为“喵安”

[[恶意卖萌]]的典型。

== 影响 ==
动画播出后喵帕斯立刻成为新的音MAD素材，现已加入<del>肯○基</del>[[鬼畜全明星]]豪华午餐<del>15元起，第二份半价</del>。

另外，喵帕斯还获得了2013年日本动画流行语大赏的金赏，有人专门为喵帕斯制作了网站<ref>[http://nyanpass.com {{lj|にゃんぱすーボタン}}]</ref>（点击「にゃんぱすー」即可获得新生）

